// Function to parse RDF data and convert it to a flattened structure with values swapped between name and children
function parseRdfData(data) {
  const lines = data.trim().split("\n");
  const flattenedData = [];

  lines.forEach((line) => {
    const parts = line.split(/\s+/);

    // Ensure parts array has at least three elements
    if (parts.length >= 3) {
      const predicate = parts[1];
      const object = parts.slice(2).join(" ");

      const predicates = predicate.split("/");
      const lastElement = predicates[predicates.length - 1];

      // Check if object is a URL (starts with "<" and ends with ">")
      const isUrl = object.startsWith("<") && object.endsWith(">");
      const nameValue = isUrl ? lastElement : object.split('"')[1]; // Extract the value within double quotes for non-URL

      // Remove ">" symbol from the name value if it exists
      const cleanedName = nameValue ? nameValue.replace(">", "") : nameValue;

      if (cleanedName) {
        flattenedData.push({ name: lastElement, value: cleanedName });
      }

      // ... rest of the code ...
    } else {
      console.error("Invalid line structure:", line);
    }
  });

  return flattenedData;
}
